import Head from 'next/head'
import NavBar from "../Components/presentational/NavBar";
import BottomBar from "../Components/presentational/BottomBar";

const index = () => {
  return (
    <React.Fragment>
      <Head>
        <title>Mollie Dixon</title>
        <meta name="description" content="The homepage for mollies business website"></meta>
      </Head>
      <div className="nav">
        <NavBar text="Facials" items={["Classic", "Collegen", "Deep Pore", "Hydrating", "Teen",  "Vitamin C"]} image="/facial.jpg"/>
        <NavBar text="Make Up" items={["Bridal Party", "Prom", "Special Occasion", "Teen"]} image="/makeup.jpg"/>
        <NavBar text="Spa" items={["MicroDerm", "MicroCurrent", "Body Wraps", "Reflexology", "Body Polish"]} image="/spa.jpg"/>
        <NavBar text="Tanning" items={["Bronze", "Face Only", "Legs Only",  "Orignal Airbrush"]} image="/tan.jpg"/>
        <NavBar text="Waxing" items={[ "Bikini", "Back", "Brow", "Leg", "Under Arm"]} image="/legs.jpg"/>
        <NavBar text="Book Now" items={["Tap Here"]} handle={()=>{}}/>
      </div>
      <BottomBar current='home'/>
    </React.Fragment>
    );

}
export default index;
